import styled from 'styled-components'

const Outer = styled.div`
    margin-top: auto;
    margin-top: 14%;

    h1{
        margin-bottom: 3%;
    }

    img{
        border-radius: 25%;
    }

    img:hover{
        border-radius: 40%;
    }

    .winDiv{
        border: 2px solid red;
        align:center;

    }
`

export default Outer
